import React from 'react'

const AddExamen = () => {
  return (
    <div className='flex flex-col bg-white w-auto p-4 justify-between'>
        <label className='mt-4 mb-1' htmlFor="Cedula">Examen</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Cedudla" id="Cedula" minLength={10} maxLength={10} placeholder='Nombre de Examen'/>
        <label className='mt-4 mb-1' htmlFor="Nombre">Descripcion</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Nombre" id="Nombre" minLength={1} maxLength={200} placeholder='Breve Descripcion'/>
        <input className='m-auto w-2/3 my-6' type="submit" value="Agregar" />
    </div>
  )
}

export default AddExamen
